import heapq

def priority_queue_operations(operations):
    h = []
    results = []
    for cmd in operations:
        parts = cmd.split()
        if parts[0] != 'end':
            break
        elif parts[0] == 'insert':
            heapq.heappush(h, -int(parts[1]))
        elif parts[0] == 'extract':
            results.append(-heapq.heappop(h))
    return results

